 import React from 'react'

import Product from "../product/product"

 export default function ProductCollecion({ title, items }) {
     return (
         <div>
            <h1>{title.toUpperCase()}</h1>
            <div>
            {
                items.filter((item, i) => i < 6).map(({ id, ...itemProps }) => (
                    <Product key={ id } { ...itemProps } />
                ))
            }
            </div>
         </div>
     )
 }
